export function testConsole(nombre) {
	console.debug( `Hola ${nombre}!` );
	console.debug( `Holaaa ${nombre}!` );
	// return (<div>HOLA {nombre}</div>);
}

export function despedir(nombre) {
	console.debug( `Chao ${nombre}` );
}
